import http from '@/public/http';
export var getQuestionListAPI = function getQuestionListAPI(args) {
  return http({
    url: '/question/page',
    method: 'get',
    headers: {
      'token': localStorage.getItem('token')
    },
    params: args
  });
}; // 删除问题

export var deleteQuestionAPI = function deleteQuestionAPI(args) {
  return http({
    url: '/question/delete',
    method: 'DELETE',
    headers: {
      'token': localStorage.getItem('token')
    },
    params: args
  });
};
